import { Link } from "react-router-dom";
import { useAuth } from "../utils/AuthProvider";

export default function AuthStatus() {
  let auth = useAuth();

  if (!auth.user?.email) {
    return (
      <p className="auth-status-message">
        คุณยังไม่ได้ล็อคอิน กดล็อกอินได้ที่นี่ <Link to="/login">LOGIN</Link>?
      </p>
    );
  }

  return (
    <div className="auth-status-welcome">
      ยินดีตต้อนรับ
      <div className="auth-status-title">{auth.user?.email}! </div>
      {/* <div className="link-name">
        ค้นหาพัสดุของคุณได้เลย <Link to="/parcel">ค้นหาพัสดุ</Link>
      </div> */}
    </div>
  );
}
